// src/services/medicoService.js
import axios from 'axios';

const API_URL = 'http://localhost:8080/medico/crud/addMedico'; // URL base da API

export const addMedico = async (medicoData) => {
  try {
    const response = await axios.post(`${API_URL}/addMedico`, medicoData);
    return response.data;
  } catch (error) {
    console.error(error); // Imprime o erro completo no console
    throw new Error('Erro ao cadastrar médico: ' + (error.response ? error.response.data : error.message));
  }
};
